
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>Unleash Chaos</title>
  
  <style>
    body {
      margin: 0;
      background: #fef6e4;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      font-family: 'Comic Sans MS', cursive;
      overflow: hidden;
      transition: background 0.3s;
    }

    #popup {
      display: none;
      flex-direction: column;
      align-items: center;
      padding: 20px;
      background: #fff;
      border-radius: 20px;
      box-shadow: 0 0 20px rgba(0,0,0,0.2);
    }

    #popup.active {
      display: flex;
    }

    #funnyImage {
      max-width: 90vw;
      max-height: 60vh;
      border-radius: 15px;
      animation: none;
    }

    #chaosButton {
      padding: 15px 30px;
      font-size: 1.5em;
      background: hotpink;
      border: none;
      border-radius: 10px;
      color: white;
      cursor: pointer;
      box-shadow: 0 5px 10px rgba(0,0,0,0.2);
      transition: transform 0.2s;
    }

    #chaosButton:active {
      transform: scale(0.95);
    }

    @keyframes goCrazy {
      0%   { transform: rotate(0deg) scale(1); }
      25%  { transform: rotate(15deg) scale(1.2); }
      50%  { transform: rotate(-15deg) scale(0.9); }
      75%  { transform: rotate(20deg) scale(1.3); }
      100% { transform: rotate(0deg) scale(1); }
    }
  </style>

</head>

  <script>
    const sounds = [
      "https://www.soundjay.com/button/sounds/button-4.mp3",
      "https://www.soundjay.com/button/sounds/button-10.mp3",
      "https://www.soundjay.com/button/sounds/button-16.mp3"
    ];

    function playRandomSound() {
      const audio = new Audio(sounds[Math.floor(Math.random() * sounds.length)]);
      audio.play();
    }

    function startChaos() {
      document.getElementById('popup').classList.add('active');
      const image = document.getElementById('funnyImage');
      image.style.animation = 'goCrazy 0.6s ease-in-out infinite';
      document.body.style.background = '#fcd5ce';

      setInterval(() => {
        document.body.style.background = `hsl(${Math.floor(Math.random() * 360)}, 100%, 90%)`;
      }, 500);

      setInterval(() => {
        playRandomSound();
      }, 2000);
    }

    window.addEventListener('load', () => {
      document.getElementById('chaosButton').addEventListener('click', startChaos);
    });
